const Product = () => {
  const [personImg, setPersonImg] = useState<string | null>(null);
  const [personImgName, setPersonImgName] = useState<string | null>(null);
  const [clothingImg, setClothingImg] = useState<string | null>(null);
  const [clothingImgName, setclothingImgName] = useState<string | null>(null);
  const [imageData, setImageData] = useState(defaultGeneratedImg);
  const [isLoading, setIsLoading] = useState(false);
  const hiddenPhotoInput = useRef<HTMLInputElement>(null);
  const hiddenClothInput = useRef<HTMLInputElement>(null);
  const [openPopup, setOpenPopup] = useState(false);

  // B2B Implementation
  const [sourceImages, setSourceImages] = useState<any[]>([]);
  const [scrapePopup, setScrapePopup] = useState(false);
  const location = useLocation();

  const handlePhotoUploadClick = () => {
    hiddenPhotoInput.current?.click();
  };

  const handleClothUploadClick = () => {
    hiddenClothInput.current?.click();
  };

  const togglPopupStatus = () => {
    if (!openPopup) handleSubmit();
    setOpenPopup(!openPopup);
  };

  const handleImageUpload = (
    e: React.ChangeEvent<HTMLInputElement>,
    setImage: React.Dispatch<React.SetStateAction<string | null>>,
    setImgName: React.Dispatch<React.SetStateAction<string | null>>
  ) => {
    e.preventDefault();
    const file = e.target.files && e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        const result = reader.result as string;
        setImage(result);
        setImgName(file.name);
      };
      reader.readAsDataURL(file);
    }
  };
  
  const handleSubmit = async () => {
    try {
      setIsLoading(true);
      toast.loading("Generating Image...", {id: "ImgGen"});
      // TODO: Implement backend token
      // await getToken();
      const imageData = {
        photo_person_name: personImgName,
        photo_clothing_name: clothingImgName,
        photo_person: personImg,
        photo_clothing: clothingImg,
      };
      const reponseImage = await uploadImage(imageData);
      toast.success("Successfully Generated New Image!", {id: "ImgGen"});
      setImageData(reponseImage.result.photo_prediction);
    } catch (error) {
      console.error(error);
      toast.error("Failed to Generate Image!", {id: "ImgGen"});
    } finally {
      setIsLoading(false);
    }
  };

  const handleDataScrape = async (sourceURL :string) => {
    try {
      setIsLoading(true);
      toast.loading("Processing Source URL", {id: "sourceURL"});
      const sourceImages = await getSourceImage(sourceURL);
      setIsLoading(false);
      toast.success("Retrieved All Images!", {id: "sourceURL"});
      setSourceImages(sourceImages.result);
      // setSourceImages(testData.result);
      setScrapePopup(true);
    } catch (error) {
      console.error(error);
      toast.error("Failed to Retrieved Image Data!", {id: "sourceURL"});
    }
  };

  const handleSelectSourceImage = (name: string, base64: string) => {
    setclothingImgName(name);
    setClothingImg(`data:image;base64,${base64}`);
    setScrapePopup(false);
  }

  useEffect(() => {
    const topDownObserver = new IntersectionObserver((entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add("top-down-show");
        }
      });
    });
    const hiddenYElements = document.querySelectorAll(".top-down-hidden");
    hiddenYElements.forEach((element) => topDownObserver.observe(element));
  }, []);

  useEffect(() => {
    const searchParams = new URLSearchParams(location.search);
    let source_url = searchParams.get('source_url');
    if (source_url) {
      source_url = source_url.replace(/'/g, '');
      handleDataScrape(source_url);
    }
  }, [location.search]);

  const PopupWindow = () => (
    <div
      className="home-card-container"
      style={{
        backgroundColor: "rgb(169, 169, 169)",
        border: "5px solid rgb(105, 105, 105)",
      }}
    >
      <p className="home-card-title">IMAGE RESULT</p>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        {isLoading ? (
          <div style={{width: "250px", height: "320px"}}>
          </div>
        ) : (
          <img
            src={`data:image/jpeg;base64,${imageData}`}
            alt="Generated AI Image"
            width="250"
            height="320"
          />
        )}
        <button
          className="log-btn"
          type="submit"
          onClick={togglPopupStatus}
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            width: "15%",
            marginBottom: "40px",
            backgroundColor: "black",
          }}
        >
          <i className="animation"></i>Close<i className="animation"></i>
        </button>
      </div>
    </div>
  );

  return (
    <div className="chat-flipIn">
      {scrapePopup? (
        <div className="SourcePopup_Background">
          <div className="SourcePopup_Container">
            <div className="SourcePopup_Title">
              <h2>RETRIEVED IMAGES</h2>
            </div>
            <div className="SourcePopup_Images_Container">
              <ul className="SourcePopup_Images_List">
                {sourceImages.map((image: any, index: number) => (
                  <div key={index} className="SourcePopup_Image_Container">
                    <img src={`data:image;base64,${image.base64}`} alt={image.name} />
                    {/* <img src={`${image.base64}`} alt={image.name} /> */}
                    {/* <p>Name: {image.name}</p> */}
                    {/* <p>URL: {image.url}</p> */}
                    <button onClick={() => handleSelectSourceImage(image.name, image.base64)}>SELECT</button>
                  </div>
                ))}
              </ul>
            </div>
          </div>
        </div>
      ) : (
        <></>
      )}
      {openPopup && (
        <div className="modal">
          <div className="modal-content">
            <PopupWindow />
          </div>
        </div>
      )}
      {isLoading? (
        <Loading />
      ) : (
        <></>
      )}
      <span
        style={{
          fontSize: "50px",
          fontWeight: "700",
          display: "block",
          textAlign: "center",
          marginTop: "50px",
        }}
      >
        Upload Two Photos
      </span>
      <Box
        sx={{
          width: "100%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          flexDirection: { md: "row", xs: "column", sm: "column" },
          gap: 20,
          my: 5,
        }}
      >
        {/* Person Image Upload Block */}
        <div
          className="home-card-container top-down-hidden"
          style={{
            backgroundColor: "rgb(235, 241, 255)",
            border: "5px solid rgb(203, 190, 252)",
          }}
        >
          <p className="home-card-title">Photo - Yourself</p>
          {personImg ? (
            <img src={personImg} alt="Yourself" width="250" height="320" />
          ) : (
            <img
              src={defaultPersonImg}
              alt="Default pose image"
              width="250"
              height="320"
            />
          )}
          <button
            className="log-btn"
            type="submit"
            onClick={handleClothUploadClick}
          >
            <i className="animation"></i>Upload<i className="animation"></i>
          </button>
          <form>
            <input
              type="file"
              ref={hiddenClothInput}
              style={{ display: "none" }}
              onChange={(e) => handleImageUpload(e, setPersonImg, setPersonImgName)}
            />
          </form>
        </div>
        {/* Clothing Image Upload Block */}
        <div
          className="home-card-container top-down-hidden"
          style={{
            backgroundColor: "rgb(203, 190, 252)",
            border: "5px solid rgb(235, 241, 255)",
          }}
        >
          <p className="home-card-title">Photo - The Clothing Item</p>
          {clothingImg ? (
            <img src={clothingImg} alt="Yourself" width="250" height="320" />
          ) : (
            <img
              src={defaultClothingImg}
              alt="Default pose image"
              width="250"
              height="320"
            />
          )}
          <button
            className="log-btn"
            type="submit"
            onClick={handlePhotoUploadClick}
          >
            <i className="animation"></i>Upload<i className="animation"></i>
          </button>
          <form>
            <input
              type="file"
              ref={hiddenPhotoInput}
              style={{ display: "none" }}
              onChange={(e) => handleImageUpload(e, setClothingImg, setclothingImgName)}
            />
          </form>
        </div>
      </Box>
      <button
        className="log-btn"
        type="submit"
        onClick={togglPopupStatus}
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          width: "200px",
          margin: "auto",
          marginTop: "50px",
        }}
      >
        <i className="animation"></i>Generate<i className="animation"></i>
      </button>
      <div
        className="footer"
        style={{
          width: "100%",
          margin: "50px",
        }}
      ></div>
    </div>
  );
};

export default Product;